// This file is intended to simplify importing individual pages.
// Exporting and importing idea from https://www.techomoro.com/how-to-create-a-multi-page-website-with-react-in-5-minutes/
export { default as Navigation } from "./Navigation";
export { default as Footer } from "./Footer";
export { default as Home } from "./Home";
export { default as Cases } from "./Cases";
export { default as About } from "./About";
export { default as SurveyReact } from "./Survey";
